import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const flname = "bansi khagram";
const tdate = new Date().toLocaleDateString();
const ttime = new Date().toLocaleTimeString();
const img1 = "https://picsum.photos/200/300";
const img2 = "https://picsum.photos/250/300";
const img3 = "https://picsum.photos/300/300";
const links = "https://web.whatsapp.com/";
//that is called template literals
const heading = {
    color : 'blue',
     textTransform: 'capitalize'
};

ReactDOM.render( 
    <> 
    <h1 className="heading" >{`my name is ${flname} `}</h1>
    <p style={heading}>{`Today date is = ${tdate} `} </p>
    <p style={heading}>{`Current Time Is = ${ttime}`} </p>

    <div className="img_div">
    <img src={img1} alt="randomimage"/>
    <img src={img2} alt="randomimage"/>
    <a href={links} target="_bansi">
    <img src={img3} alt="randomimage"/>
    </a>
    </div>
    </>, 
    document.getElementById("root"));
